--
-- Name: v_cc_rels; Type: VIEW; Schema: http_datos_bcn_ck_sparql; Owner: -
--

CREATE VIEW http_datos_bcn_ck_sparql.v_cc_rels AS
 SELECT r.id,
    r.class_1_id,
    r.class_2_id,
    r.type_id,
    r.cnt,
    r.data,
    c1.iri AS iri1,
    c1.classification_property AS cprop1,
    c2.iri AS iri2,
    c2.classification_property AS cprop2
   FROM http_datos_bcn_ck_sparql.cc_rels r,
    http_datos_bcn_ck_sparql.classes c1,
    http_datos_bcn_ck_sparql.classes c2
  WHERE ((r.class_1_id = c1.id) AND (r.class_2_id = c2.id));


--
-- Name: v_classes_ns; Type: VIEW; Schema: http_datos_bcn_ck_sparql; Owner: -
--

CREATE VIEW http_datos_bcn_ck_sparql.v_classes_ns AS
 SELECT c.id,
    c.iri,
    c.cnt,
    c.ns_id,
    n.name AS prefix,
    c.props_in_schema,
    c.local_name,
    c.display_name,
    c.classification_property_id,
    c.classification_property,
    c.classification_adornment,
    c.is_literal,
    c.datatype_id,
    c.instance_name_pattern,
    c.indirect_members,
    c.is_unique,
    concat(n.name, ',', c.local_name, ',', c.classification_adornment, ',', c.display_name, ',', lower(c.display_name)) AS namestring,
    http_datos_bcn_ck_sparql.tapprox(c.cnt) AS cnt_x,
    n.is_local,
    c.large_superclass_id,
    c.hide_in_main,
    c.principal_super_class_id,
    c.self_cp_rels,
    c.cp_ask_endpoint,
    c.in_cnt
   FROM (http_datos_bcn_ck_sparql.classes c
     LEFT JOIN http_datos_bcn_ck_sparql.ns n ON ((c.ns_id = n.id)));


