--
-- Name: v_cp_rels; Type: VIEW; Schema: http_datos_bcn_ck_sparql; Owner: -
--

CREATE VIEW http_datos_bcn_ck_sparql.v_cp_rels AS
 SELECT r.id,
    r.class_id,
    r.property_id,
    r.type_id,
    r.cnt,
    r.data,
    r.object_cnt,
    r.data_cnt_calc AS data_cnt,
    r.max_cardinality,
    r.min_cardinality,
    r.cover_set_index,
    r.add_link_slots,
    r.details_level,
    r.sub_cover_complete,
    http_datos_bcn_ck_sparql.tapprox((r.cnt)::integer) AS cnt_x,
    http_datos_bcn_ck_sparql.tapprox(r.object_cnt) AS object_cnt_x,
    http_datos_bcn_ck_sparql.tapprox(r.data_cnt_calc) AS data_cnt_x,
    r.cnt_base,
        CASE
            WHEN (COALESCE(r.cnt_base, (0)::bigint) = 0) THEN r.cnt
            ELSE ((((r.cnt / r.cnt_base) * c.cnt))::integer)::bigint
        END AS cnt_estimate,
    c.iri AS class_iri,
    c.classification_property_id AS class_cprop_id,
    c.classification_property AS class_cprop,
    c.is_literal AS class_is_literal,
    c.datatype_id AS cname_datatype_id,
    p.iri AS property_iri
   FROM http_datos_bcn_ck_sparql.cp_rels r,
    http_datos_bcn_ck_sparql.classes c,
    http_datos_bcn_ck_sparql.properties p
  WHERE ((r.class_id = c.id) AND (r.property_id = p.id));


